import { StyleSheet } from "react-native"

export default StyleSheet.create({
    container:{
        flex:2,
        backgroundColor:"rgb(247,247,247)",
        alignItems:"center",
        justifyContent:"center"
    },
    filterBtn:{
        borderRadius:20, 
        borderColor:"rgba(8,84,160,255)", 
        borderWidth:1,
        backgroundColor:"#fff", 
        width:150,
        alignItems:"center", 
        justifyContent:"center",
        marginTop:10,
        height:30
    }
})
